struct casadi_nlpsol_prob {
  casadi_int nx, ng, np;
};
struct casadi_nlpsol_data {
  const struct casadi_nlpsol_prob* prob;
  casadi_real *lbz, *ubz;
  const casadi_real *p;
  casadi_real *z;
  casadi_real *lam, *lam_p;
  casadi_real f;
};
void casadi_nlpsol_work(const struct casadi_nlpsol_prob* p, casadi_int* sz_iw, casadi_int* sz_w) {
  *sz_w = *sz_iw = 0;
  *sz_w += p->nx + p->ng;
  *sz_w += p->nx + p->ng;
  *sz_w += p->nx + p->ng;
  *sz_w += p->nx + p->ng;
  *sz_w += p->np;
}
void casadi_nlpsol_init(struct casadi_nlpsol_data* d, casadi_int** iw, casadi_real** w) {
  casadi_int nx, ng, np;
  const struct casadi_nlpsol_prob* p = d->prob;
  nx = p->nx;
  ng = p->ng;
  np = p->np;
  d->z = *w; *w += nx + ng;
  d->lbz = *w; *w += nx + ng;
  d->ubz = *w; *w += nx + ng;
  d->lam = *w; *w += nx + ng;
  d->lam_p = *w; *w += np;
}

struct casadi_sqpmethod_prob {
  const struct casadi_nlpsol_prob* nlp;
  const casadi_int *sp_h, *sp_a;
  casadi_int merit_memsize;
  casadi_int max_iter_ls;
};
struct casadi_sqpmethod_data {
  const struct casadi_sqpmethod_prob* prob;
  casadi_real* z_cand;
  casadi_real *gLag, *gLag_old;
  casadi_real *gf;
  casadi_real *lbdz, *ubdz;
  casadi_real *dx, *dlam;
  casadi_real* Bk;
  casadi_real* Jk;
  casadi_real* merit_mem;
};
void casadi_sqpmethod_work(const struct casadi_sqpmethod_prob* p,
    casadi_int* sz_iw, casadi_int* sz_w) {
  casadi_int nnz_h, nnz_a, nx, ng;
  nnz_h = p->sp_h[2+p->sp_h[1]];
  nnz_a = p->sp_a[2+p->sp_a[1]];
  nx = p->nlp->nx;
  ng = p->nlp->ng;
  *sz_w = *sz_iw = 0;
  if (p->max_iter_ls>0) *sz_w += nx + ng;
  *sz_w += nx;
  *sz_w += nx;
  *sz_w += nx;
  *sz_w += nx + ng;
  *sz_w += nx + ng;
  *sz_w += nx;
  *sz_w += nx + ng;
  *sz_w += nnz_h;
  *sz_w += nnz_a;
  if (p->max_iter_ls>0) *sz_w += p->merit_memsize;
}
void casadi_sqpmethod_init(struct casadi_sqpmethod_data* d, casadi_int** iw, casadi_real** w) {
  casadi_int nnz_h, nnz_a, nx, ng;
  const struct casadi_sqpmethod_prob* p = d->prob;
  nnz_h = p->sp_h[2+p->sp_h[1]];
  nnz_a = p->sp_a[2+p->sp_a[1]];
  nx = p->nlp->nx;
  ng = p->nlp->ng;
  if (p->max_iter_ls>0) {
    d->z_cand = *w;
    *w += nx + ng;
  }
  d->gLag = *w; *w += nx;
  d->gLag_old = *w; *w += nx;
  d->gf = *w; *w += nx;
  d->lbdz = *w; *w += nx + ng;
  d->ubdz = *w; *w += nx + ng;
  d->dx = *w; *w += nx;
  d->dlam = *w; *w += nx + ng;
  d->Bk = *w; *w += nnz_h;
  d->Jk = *w; *w += nnz_a;
  if (p->max_iter_ls>0) {
    d->merit_mem = *w;
    *w += p->merit_memsize;
  }
}

casadi_real casadi_max_viol(casadi_int n, const casadi_real* x, const casadi_real* lb, const casadi_real* ub) {
  casadi_real r;
  casadi_int i;
  const casadi_real zero = 0;
  r = 0;
  for (i=0; i<n; ++i) {
    casadi_real x_i, lb_i, ub_i;
    x_i = x ? *x++ : zero;
    lb_i = lb ? *lb++ : zero;
    ub_i = ub ? *ub++ : zero;
    r = fmax(r, fmax(x_i-ub_i, zero));
    r = fmax(r, fmax(lb_i-x_i, zero));
  }
  return r;
}

casadi_real casadi_norm_inf(casadi_int n, const casadi_real* x) {
  casadi_int i;
  casadi_real ret = 0;
  for (i=0; i<n; ++i) ret = casadi_fmax(ret, fabs(*x++));
  return ret;
}

casadi_real casadi_isinf(casadi_real x) {
/* Pre-c99 compatibility */
#if __STDC_VERSION__ < 199901L
  return x== INFINITY || x==-INFINITY;
#else
  return isinf(x);
#endif
}

void casadi_bound_consistency(casadi_int n, casadi_real* x, casadi_real* lam,
                                 const casadi_real* lbx, const casadi_real* ubx) {
    casadi_int i;
    casadi_real lb, ub;
    for (i=0; i<n; ++i) {
      lb = lbx ? lbx[i] : 0.;
      ub = ubx ? ubx[i] : 0.;
      x[i] = casadi_fmin(casadi_fmax(x[i], lb), ub);
      if (casadi_isinf(lb) && casadi_isinf(ub)) {
        lam[i] = 0.;
      } else if (casadi_isinf(lb) || x[i] - lb > ub - x[i]) {
        lam[i] = casadi_fmax(0., lam[i]);
      } else if (casadi_isinf(ub) || x[i] - lb < ub - x[i]) {
        lam[i] = casadi_fmin(0., lam[i]);
      }
    }
}

